  const [count , setcount] = useState(0);

function eventHandler(){
  setcount(count + 1);
}
return(
   <button onClick={eventHandler}>
    Change {count} time
   </button>
  );
}


export default function MyApp(){
  return(
    <div>

      <h1>
    Event usestate count
    </h1>
  <MyButton/>
  <MyButton/>
    </div>

  );

}
